      },
      {
        name: 'Subfolder 5.5',
        files: ['File 21', 'File 22', 'File 23', 'File 24', 'File 25'],
      },
    ],
  },
];

const App = () => {
  return (
    <div className='App bg-green-900'>
      {mainFolders.map((mainFolder, index) => (
        <MainFolder key={index} mainFolder={mainFolder} />
      ))}
    </div>
  );
};

export default App;
